impl Solution {
    pub fn max_number_of_alloys(n: i32, k: i32, budget: i32, composition: Vec<Vec<i32>>, stock: Vec<i32>, cost: Vec<i32>) -> i32 {
        let mut max_alloys = 0;
        for i in 0..k as usize {
            let mut total_cost = 0;
            for j in 0..n as usize {
                let needed = composition[i][j] - stock[j];
                if needed > 0 {
                    total_cost += needed * cost[j];
                }
            }
            let mut alloys = budget / total_cost;
            while alloys * total_cost > budget {
                alloys -= 1;
            }
            max_alloys = max_alloys.max(alloys);
        }
        max_alloys
    }
}
